\$array=<array>; map { \$_->[0] } sort { \$a->[1] <=> \$b->[1] } map { [\$_, -\$_] } \@\$array",description=>"\nSchwartzian transform (also known as map/sort/map technique) caches the sort key\nin an arrayref. It works by constructing, for each array element, a container\nrecord (most often anonymous arrayref) containing the original element and the\nkey to be sorted. Later after the sort, it discards the anonymous arrayrefs. The\narrayref construction is a significant part of the total cost, especially for\nlarger arrays.\n\nIn Perl code:\n\n    \@sorted = map { \$_->[0] } sort { \$a->[1] <=> \$b->[1] } map { [\$_, GEN_KEY(\$_)] } \@array;\n\n",include_by_default=>1,name=>"ST",result_is_list=>1,seq=>1,type=>"perl_code"},{code_template=>"state \$array=<array>; map { \$_->[0] } sort { \$a->[1] <=> \$b->[1] } map { [\$_, -\$_] } \@\$array",description=>"\nGuttman-Rosler transform, another map/sort/map technique, is similar to ST. The\ndifference is, the computed key is transformed into a fixed-length string that\ncan be compared lexicographically (thus eliminating the need for the Perl custom\nsort block). The original element is also transformed as a string and\nconcatenated into the string. Thus, GRT avoids the construction of the anonymous\narrayrefs. As a downside, the construction of the key string can be tricky.\n\nIn Perl code (assuming the compute key is transformed into a fixed 4-byte\nstring:\n\n    \@sorted = map { substr(\$_, 4) } sort map { pack(\"NN\", -\$_, \$_) } \@array;\n\n",include_by_default=>1,name=>"GRT",result_is_list=>1,seq=>2,type=>"perl_code"},{code_template=>"state \$array=<array>; my \@keys = map { -\$_ } \@\$array; my \@indexes = 0..\$#{\$array}; map { \$array->[\$_] } sort { \$keys[\$a] <=> \$keys[\$b] } \@indexes",description=>"\nThis technique caches the compute key in a single array. It also constructs an\narray of indexes, sorts the array according to the array keys, then constructs\nthe final sorted array using the sorted indexes.\n\nCompared to GRT, it constructs far fewer anonymous arrayrefs. But it still\nrequires Perl custom sort block.\n\nIn Perl code:\n\n    \@indexes = 0 .. \$#array;\n    \@keys    = map { GEN_KEY(\$_) } \@array;\n    \@sorted  = map { \$array[\$_] } sort { \$keys[\$a] <=> \$keys[\$b] } \@indexes;\n\n",include_by_default=>1,name=>"2array",result_is_list=>1,seq=>3,type=>"perl_code"},{code_template=>"state \$array=<array>; Sort::Key::nkeysort(sub { -\$_ }, \@\$array)",description=>"\nThis module also caches the compute keys. It's faster because it's implemented\nin XS. The compute key must be string (to be compared lexicographically) or\nnumeric.\n\n",function=>"nkeysort",include_by_default=>1,module=>"Sort::Key",name=>"Sort::Key::nkeysort",result_is_list=>1,seq=>4,type=>"perl_code"}],summary=>"Benchmark various techniques to sort array by some computed key"}},"func.bencher_version"=>undef,"func.code_startup"=>undef,"func.cpu_info"=>[{L2_cache=>{max_cache_size=>"3072 KB"},address_width=>64,architecture=>"AMD-64",bus_speed=>undef,data_width=>64,family=>6,flags=>["fpu","vme","de","pse","tsc","msr","pae","mce","cx8","apic","sep","mtrr","pge","mca","cmov","pat","pse36","clflush","dts","acpi","mmx","fxsr","sse","sse2","ss","ht","tm","pbe","syscall","nx","pdpe1gb","rdtscp","lm","constant_tsc","art","arch_perfmon","pebs","bts","rep_good","nopl","xtopology","nonstop_tsc","cpuid","aperfmperf","tsc_known_freq","pni","pclmulqdq","dtes64","monitor","ds_cpl","vmx","est","tm2","ssse3","sdbg","fma","cx16","xtpr","pdcm","pcid","sse4_1","sse4_2","x2apic","movbe","popcnt","tsc_deadline_timer","aes","xsave","avx","f16c","rdrand","lahf_lm","abm","3dnowprefetch","cpuid_fault","epb","invpcid_single","pti","ssbd","ibrs","ibpb","stibp","tpr_shadow","vnmi","flexpriority","ept","vpid","ept_ad","fsgsbase","tsc_adjust","bmi1","avx2","smep","bmi2","erms","invpcid","mpx","rdseed","adx","smap","clflushopt","intel_pt","xsaveopt","xsavec","xgetbv1","xsaves","dtherm","ida","arat","pln","pts","hwp","hwp_not